import axios from 'axios'

class HelloWorldService {
    executeHelloWorldPathVariableService(name) {
        const token = sessionStorage.getItem('token')

        var config = {
            method: 'get',
            url: 'http://localhost:8082/users/shubham/todos',
            headers: { 
              'Authorization': 'Bearer eyJhbGciOiJIUzUxMiJ9.eyJzdWIiOiJzaHViaGFtIiwiZXhwIjoxNjIwOTMyOTA5LCJpYXQiOjE2MjA5MTQ5MDl9.gIhuLxbmIgYnxOPNtwAB-XZC4fsAQGUii4XGNEfne5v6jvzoxPRmoXEjwpmYd6lr8f0wKVLbV8E6LeRXPzOQ3w'
            }
          };
          
          axios(config)

        console.log(token)
        return axios.get(`http://localhost:8082/hello-world/path-variable/${name}`,
        {
            headers : {
                'Authorization' : `Bearer ${token}`
            }
        })
    }
}

export default new HelloWorldService()
